import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        int tc = sc.nextInt();
        while (tc-- > 0) {
            int rows = sc.nextInt();
            int cols = sc.nextInt();
            int[] arr1 = new int[cols];
            int[] arr2 = new int[cols];
            int max = Integer.MIN_VALUE;
            if (cols >= 2) {
                for (int i = 0; i < cols; i++) {
                    arr1[i] = sc.nextInt();
                }
                rows--;
                while (rows-- > 0) {
                    int input = sc.nextInt();
                    arr2[0] = Math.max(arr1[0] + input, arr1[1] + input);
                    for (int i = 1; i < cols - 1; i++) {
                        input = sc.nextInt();
                        int temp = Math.max(arr1[i - 1] + input, arr1[i] + input);
                        temp = Math.max(temp, arr1[i + 1] + input);
                        arr2[i] = temp;
                    }
                    input = sc.nextInt();
                    arr2[cols - 1] = Math.max(arr1[cols - 2] + input, arr1[cols - 1] + input);
                    arr1 = Arrays.copyOf(arr2, cols);
                }

                for (int i = 0; i < cols; i++) {
                    if (max < arr1[i]) {
                        max = arr1[i];
                    }
                }
            }else{
                max =0;
                for(int i =0; i<rows; i++){
                    max += sc.nextInt();
                }
            }
            sb.append(max + "\n");
        }
        System.out.println(sb);
    }

    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
}
